import './App.css';
import Navbar from './Navbar';
import Home from './Home';
import { useState } from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import Userprofile from './Userprofile';
import Tablelist from './Tablelist';
import Maps from './Maps';

function App() {
  const [isNavbarOpen, setIsNavbarOpen] = useState(false);

  const toggleNavbar = () => {
    setIsNavbarOpen(!isNavbarOpen);
  };

  return (
    <>
      <div className='flex'>
        <div className={`fixed md:block ${isNavbarOpen ? 'block' : 'hidden'} md:relative w-3/6 md:w-auto`}>
          <Navbar closeNavbar={toggleNavbar} />
        </div>
        <div className='w-full md:ml-56 md:min-w-48'>
          <button className='md:hidden p-4' onClick={toggleNavbar}>
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" className="w-6 h-6">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16m-7 6h7" />
            </svg>
          </button>
          <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/userprofile' element={<Userprofile />} />
            <Route path='/tablelist' element={<Tablelist />} />
            <Route path='/typograpy' element={<Userprofile />} />
            <Route path='/icons' element={<Userprofile />} />
            <Route path='/maps' element={<Maps />}></Route>
          </Routes>
        </div>
      </div>
    </>
  );
}

export default App;
